import React from 'react';
import styles from './Input.module.css';

const Input = ({ id, type, label, ...props }) => {
  return (
    <div className={styles.inputContainer}>
      <label htmlFor={id}>
        {label} <input type={type} id={id} {...props} />
      </label>
    </div>
  );
};

export default Input;
